import React from 'react';
import './LaunchingSoon.scss';
import Plx from 'react-plx';

const LaunchingSoon = () => {
  return (
    <div className='launchingSoon'>

        <Plx
            parallaxData={[
            {
                start: 0,
                end: 700,
                easing: "ease-in",
                properties: [
                {
                    startValue: 1,
                    endValue: 5,
                    property: "scale"
                }
                ]
            }
            ]}
            style={{
            position: "fixed",
            left: 0,
            top: 0,
            width: "100%",
            zIndex: 100
            }}
        >
            <img style={{ width: "100%", height: "100vh"}} src="/img/border-gradient.png" alt="foreground" />
        </Plx>

        <Plx
            parallaxData={[
            {
                start: 0,
                end: 800,
                properties: [
                {
                    startValue: 1,
                    endValue: 1.18,
                    property: "scale"
                }
                ]
            }
            ]}
            style={{  
            position: "fixed",
            left: 0,
            top: 0,
            width: "100%"
            }}
        >
            <img style={{ width: "100%", height: "100vh"}} src="/img/MillionDollarPosters-comingsoon.png" alt="background" />
        </Plx>

        <Plx
            parallaxData={[
            {
                start: 0,
                end: 400,
                properties: [
                {
                    startValue: 1,
                    endValue: 0,
                    property: "opacity"
                }
                ]
            }
            ]}
            style={{
            position: "fixed",
            left: 0,
            top: "26vw",
            width: "100%"
            }}
        >

            <h1 className='milliondollarposters'>
                MillionDollarPosters
            </h1>

            <p className='copyright'>Â© Copyright 2023. All Rights Reserved</p>

        </Plx>

        <Plx
            parallaxData={[
            {
                start: 0,
                end: 400,
                properties: [
                {
                    startValue: 0,
                    endValue: 1,
                    property: "opacity"
                }
                ]
            }
            ]}
            style={{
            position: "fixed",
            left: 0,
            top: "26vw",
            width: "100%"
            }}
        >

            <h1 className='launch'>
                Launching Soon.
            </h1>

        </Plx>

        <Plx
            parallaxData={[
                {
                    start: 0,
                    end: 1000,
                    properties: [
                    {
                        startValue: 0,
                        endValue: 1,
                        property: "opacity"
                    }
                    ]
                }
                ]}
                style={{
                position: "fixed",
                left: 0,
                top: "26vw",
                width: "100%"
                }}
        >

            <h1>Logos</h1>

        </Plx>

    </div>
  )
}

export default LaunchingSoon
